INSERT INTO `HsyListing` (`title`,`price`,`uid`,`location`,`content`,`type`,`ownerId`,`lastUpdated`,`imageIds`) VALUES ('Fremont, stevenson blvd 附近studio 招租',0,'3af55f25-6476-412f-92ae-6d09febbdcdf',?,'Fremont, Stevenson st 有一新装修studio出租， 350 plus sqft.\n\n配有全套家具，一个全新的冰箱，微波炉，电磁炉（功率很高完全可以做自己喜欢的菜～），Queen Size 床（底下木板铺的…对颈椎特别好），全新衣柜还有一个全身镜，新沙发，一个非常大的学习桌学习桌（有一个大柜子是带锁的），很舒服的沙发座椅，全新的豪华独立卫生间。 \n提供洗衣机，烘干机。\n独立出入，特别安静。 \n要求单身租客一人，正职/full time学生, 无烟酒，无宠物， 无party， 无过夜客人。$1350 订金 + 首月租, 9.10可入住, 最佳租期为6个月. \n5~8分钟Tesla, Ohlone college, 15~20分钟到Facebook, Cisco等湾区公司。2~ 3 mile 距离内含24hour fitness, 韶山冲, Costco, Target, Walmart, 狮子城, AMC等娱乐休闲购物饮食场所.\n有兴趣请联系微信138100128,谢谢。\n\n地理位置很不错距离湾区的公司都蛮近的。同时开车去bart站五分钟那样…周末去三番玩都很方便…然后fremont城市中国人非常多也有很多好吃的中餐馆…非常适合中国人居住^_^希望大家有兴趣都可以来看一下～\n\nps 照片拍的不专业…实际更好看哦～',0,'enNqMjU1MDJAaG90bWFpbC5jb20=','2016-09-07 08:54:20',NULL);
INSERT INTO `HsyListing` (`title`,`price`,`uid`,`location`,`content`,`type`,`ownerId`,`lastUpdated`,`imageIds`) VALUES ('San Bruno 2居室其中一间卧室寻长期室友，11月20日可以入住，近YouTube, Walmart, BART, 280, 101',0,'4395753e-9072-45f0-a302-02e9d9b5fbdf',?,'San Bruno后山上的2B1B apartment寻长期室友。小区非常安静也非常安全，交通便利，秒上280和101，特别适合在YouTube, Walmart, 或是坐BART到三番上班的人。阳台风景超赞，有bay view。\n\n目前主卧住着一对新婚夫妇，白天上班，周末爱出去玩，爱干净整洁。之前次卧一直在做airbnb，现在打算长租，如果没有自己的家具可以拎包入住。图片及review可以在airbnb上看到：https://www.airbnb.com/rooms/11723606?preview\n\n对新室友要求不高：1. 维持公共空间的整洁；2.不在家里办Party\n\n租金：$1200 + utility(水电网加起来大概100左右)\n\n地址：2081 Whitman Way, San Bruno, CA 94066\n1分钟可到达：I-280\n3分钟可到达：US-101\n5分钟可到达：YouTube, Walmart办公室，SFO，Safeway\n7分钟可到达：San Bruno BART\n\n联系方式：Fey 650-995-1776',0,'dGhkLnRodUBnbWFpbC5jb20=','2016-10-25 07:10:19','[\"m9mu4sa0e8hwwsqsgk0r\",\"mcihkqr7xjfpjhu6fg9i\",\"vdractzvtxtl0fols82x\",\"enxzibk1p2znzrallsn4\",\"xmagrw4t4m7pehqnl8fq\"]');
