INSERT INTO `HsyListing` (`title`,`price`,`uid`,`location`,`content`,`type`,`ownerId`,`lastUpdated`,`imageIds`) VALUES ('即日起转租公寓（离bart步行距离2分钟，去三番downtown 20分钟）[South San Francisco]',0,'d86a7ea8-65f5-4fd2-b512-ea75fc938f48',?,'由于工作调动，要往南搬家。想sublease现在租的1b1b （750 sqft)，原价月租$2700，我们可以补贴一点cash，地理位置极其方便－公寓就在bart对面，步行距离内就有starbucks, trader joe\'s, costco。很适合在城里上班的朋友。 有兴趣的请尽快联系我。\n\n房间内有wash & drier; 小区里有hot tub, 健身房，烧烤架, club house等等设施。\n\nhttp://www.equityapartments.com/san-francisco-bay/south-san-francisco/south-city-station-apartments',0,'bGFiMTI2bHVAZ21haWwuY29t','2016-11-19 22:46:32','[\"knvnganexj1zwrvjw55k\",\"zyoxfqtma8kggiiy7wi1\"]');
